import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className=" min-h-screen flex items-center justify-between relative">
      <header className="mx-auto p-4">
      <div className="mx-auto text-center">
      <img
          src="your-image-url.jpg"
          alt="Your Image"
          className="mx-auto rounded-full w-32 h-32"
        />
      </div>
        <button className="bg-yellow-700 text-white p-2 rounded-md cursor-pointer absolute top-5 right-5 text-xl">
          Sign up
        </button>
      </header>
    </div>
  );
}

export default App;
